import React, { useState } from 'react';
import './App.css';
import Chatbot from './components/Chatbot';
import Expenses from './components/Expenses';
import Groceries from './components/Groceries';
import Salary from './components/Salary';
import ProteinTracker from './components/ProteinTracker';
import WaterTracker from './components/WaterTracker';

function App() {
  const [activeTab, setActiveTab] = useState('chatbot');

  const renderContent = () => {
    switch (activeTab) {
      case 'expenses':
        return <Expenses />;
      case 'groceries':
        return <Groceries />;
      case 'salary':
        return <Salary />;
      case 'protein':
        return <ProteinTracker />;
      case 'water':
        return <WaterTracker />;
      case 'chatbot':
      default:
        return <Chatbot />;
    }
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>My Homemaker</h1>
        <nav>
          <button onClick={() => setActiveTab('chatbot')} className={activeTab === 'chatbot' ? 'active' : ''}>Chatbot</button>
          <button onClick={() => setActiveTab('expenses')} className={activeTab === 'expenses' ? 'active' : ''}>Expenses</button>
          <button onClick={() => setActiveTab('groceries')} className={activeTab === 'groceries' ? 'active' : ''}>Groceries</button>
          <button onClick={() => setActiveTab('salary')} className={activeTab === 'salary' ? 'active' : ''}>Salary/Income</button>
          <button onClick={() => setActiveTab('protein')} className={activeTab === 'protein' ? 'active' : ''}>Protein Intake</button>
          <button onClick={() => setActiveTab('water')} className={activeTab === 'water' ? 'active' : ''}>Water Intake</button>
        </nav>
      </header>
      <main>
        {renderContent()}
      </main>
    </div>
  );
}

export default App;
